    data: |
      SELECT DISTINCT - col2 * - - col2 + + col0 + + col0 + 77 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 6 * col0 + - - col0 - - 77 - + 29 + - + col0 * + col1 / - - 14 IS NOT NULL;
  - name: tab0

outputs:
  - name: q585.out
    data: |
